import React from 'react';
import { carData } from '../carData';

export const CarList = () => {
    const styles={
        columns:{
            border:'1px solid black',
            display:'flex',
            margin:'10px 10px',
            padding:'10px'
        },
        list:{
            textAlign:'left',
            margin:'10px'
        },
        carButton:{
            backgroundColor:'#ECECEC',
            fontSize:'20px',
            cursor:'pointer',
            width:'100%'
        }
    }
  return (
      <div style={styles.columns}>
          <div style={styles.list}>
            {carData.map(car=> (
                <div>
                    <button style={styles.carButton}>{car.Name}</button>
                </div>

            ))}
        </div>
        <div style={styles.displayDetails}>
                    ABC
        </div>
      </div>


  )
}
